import React, { Component } from 'react';
import { Container, Col, Row, Navbar } from "react-bootstrap";
import "./Iam.css"
import me from '../../Assets/undraw_web_developer_re_h7ie.svg'

class Iam extends Component {

    render(){
        return(
            <div className='iam-container'>
                <h2 className='blurb'>"Hello Shopify"</h2>
                <h2 className='title'>I am a developer, I have worked with multiple different technologies in my path to be a developer. Here are some that I feel that would be relevent to this role.</h2>
                <div className='illustration-section'>
                    <img src={me} style={{ height: 306, width: 272 }} alt="Your SVG" />
                    <p className='longer-blurb'>I have worked on a ton of projects which has given me experinece in different industy standard technologies like the MERN Stack, Swift, Firebase while still having the fundamentals skills like HTML, CSS and Javascript </p>
                </div>
            </div>
        )}

}

export default Iam
